import React from 'react';


class Note extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            clicker: 0,
        };
    }

    toggleClass(i) {
        var newclicker = this.state.clicker + 1;
        this.setState({ clicker: newclicker });
        console.log(this.state.clicker);
        // if(!this.props.clean){
        // const currentState = this.state.active;
        // this.setState({ active: !currentState });
        // } else {
        //     this.setState({ active: false });
        // }
        // console.log(this.state.active);
        this.props.onClick(i);
    };



    render() {
        // console.log(this.props.clean);

        return (
            <button
                className={this.props.styling}
                onClick={(i) => this.toggleClass(i)}
                value={this.props.value}
                >
                {this.props.value}
            </button>
          );
        }
    }
    export default Note;
